import React, { Component } from 'react';
import { Link } from "react-router-dom";
import NavBar from '../../components/Navbar/Navbar';
import DetailHeader from '../../components/DetailHeader/DetailHeader';
import { StickyContainer, Sticky } from 'react-sticky';
import 'bootstrap/dist/css/bootstrap.css';
import { Bootstrap, Grid, Row, Col, Image } from 'react-bootstrap';

import './InSync.css';

class InSync extends Component {
  render() {
    return (
      <div id={this.props.id} className="detail-page">

        <DetailHeader name="InSync" role="Developer" date="June - Aug 2016"
          tagline="Bringing collaboration and fun to your music streaming experience."/>

          <Grid>
             <Row className="detail-row">
             <Col xs={6}>
               <img className="image-left logo" src={IGProfile}/>
             </Col>
             <Col xs={6}>
               <Caption side="caption-right caption-top" header="Video Infra"
                text="I worked on the iOS side of the IG Video Infra team in Menlo Park in 2017. For my
                main project, I developed a solution to optimize video uploading on the iOS app. For my
                secondary project, I communicated with IG Direct engineers to help unify media uploads
                from different points in the app."/>
             </Col>
            </Row>

            <Row className="detail-row">
              <Col xs={6}>
                 <Caption side="caption-left caption-bottom" header="Metrics Infra"
                  text=<p>In 2018, I interned on IG Metrics Infra, a sub-team of IG Client Stability, a core
                  client team based in NYC that keeps Instagram running smoothly. <br/> I designed and developed an
                  internal data visualization tool to allow employees on various teams across the company to
                  better utilize and understand IG's logging framework on the iOS side.<br/> This involved
                  presenting design ideas, meeting with different IG employees, and an iterative process of
                  improving my tool.</p>/>
              </Col>

              <Col xs={6}>
               <img className="image-right logo" src={IGExplore}/>
              </Col>
            </Row>
          </Grid>

      </div>
    );
  }
}

export default InSync;
